import logo from '../../assets/img/logo.jpg';
import iuser from '../../assets/img/user.svg';
import './header.css';

function Header() {
  return (
  	<header>
  	<div className="logo">
      <img src={logo} width="400px" />
  	</div>
  	<div className="btn">
  	<button className="btn-azul"> <img src={iuser} width="15px" />Ingresar</button>
  	</div>
  	</header>
  );
} 

export default Header;
